// SPDX-License-Identifier: MIT OR LGPL-2.0-or-later

pragma solidity ^0.8.5;

import "./ExternalStorage.sol";

/**
 * @title Escrow token
 *
 * @dev Implementation of the Escrow standard token.
 */
contract Escrow is ExternalStorage {
   /**
    * @dev Sets airline and flight detail for escrow
    */
    constructor (
        address _airline, 
        string memory _flightCode,
        string memory _flightDeparture, 
        string memory _flightArrival, 
        string memory _flightTime,
        uint32 _flightStatus,
        uint256 _flightRefund,
        uint256 _bookingRefund,
        uint256 _delayRefund
        )  
         {
        escrows.AirlineID = _airline;
        escrows.FlightCode = _flightCode;
        escrows.FlightDeparture = _flightDeparture;
        escrows.FlightArrival = _flightArrival;
        escrows.FlightTime = _flightTime;
        escrows.FlightStatus = _flightStatus;
        escrows.FlightRefund = _flightRefund;
        escrows.BookingRefund = _bookingRefund;
        escrows.DelayRefund = _delayRefund;
}

   //SETTERS
    function setAirline(
            uint32 FlightStatus
      ) 
        public  
        returns (bool) {
            escrows.FlightStatus = FlightStatus;
        return (true);
    }

    //GETTERS
    function getAirline() 
        public 
        view 
        returns (
            EscrowDetails memory
            ) {
        return (
            escrows
            );
    }
}
